import Breadcrumb from 'react-bootstrap/Breadcrumb'

const LanguageSelect = ({langauge, changeLangauge}) => {
    return ( 
        <Breadcrumb className ='text-secondary' variant='secondary'>
            <Breadcrumb.Item className ='text-secondary' active = {langauge === 'english'? true: false} onClick={changeLangauge} value='english'>English</Breadcrumb.Item>
            <Breadcrumb.Item className ='secondary' 
            // active= {langauge === 'russian'? true: false} 
             onClick={changeLangauge} 
            // value='russian'
            >Русский</Breadcrumb.Item>
      </Breadcrumb>
     );
}
 
export default LanguageSelect;
